import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';
import { useState } from "react";


function App() {

  //Hook
  const [servicios, agregarServicios] = useState(
    [
      {id:1 , nombre:"Macalma", Precio:2500, AnioLanzamiento:2015 },
      {id:2 , nombre:"Colores de la oscuridad", Precio:2500, AnioLanzamiento:2018 },
      {id:3 , nombre:"nuevo Disco", Precio:2500, AnioLanzamiento:2018 },
   ]
  ); 

  const redSocial = 'FEISBU'
  return (
    <div className='dark'>
       <Header/>
      <h1>Macalma</h1>
      {
        servicios.map(servicio => (
          <p> Ver disco: {servicio.nombre}</p>
        ))
      }

      <Footer
        redSocial={redSocial}
      />
    </div>
  );
}

export default App;
